import ImageSlider from "../Slider/ImageSlider";
import { SliderData } from "../Slider/SliderData";

const HomePage = () => {
    return (
        <>
        <header>Welcome to Sneaker Shop</header> 
        <ImageSlider slides ={SliderData}/>
        </>
        
     );
}
 
export default HomePage;
